import React from "react";
import TodoListItem from "./todo-list-item";

const TodoList = ({todos}) => {
    const items = todos.map((item) => {
        return(
            <TodoListItem {...item} />
        );
    });
    return (
      <ul>
        {items}
      </ul>
    );
};

export default TodoList;
